.main__scroll::after {
    @include after-black;
}

.scroll__dot {
    width: 8px;
    height: 8px;
    border-radius: 8px;
    background: $white;
    margin-bottom: 2.5em;
}

.scroll__dot:last-child {
    height: 60px;
}

// MAIN CONTENT

.main__content {
    position: relative;
    grid-column: 2 / span 4;
    grid-row: 3 ;
    border-right: 1px solid $lightgray;
    display: flex;
    @media all and (max-width: $mobile) {
        padding: 0 20px;
        flex-direction: column;
        grid-column: 1/span 5;
        grid-row: 2;
    }
}

.content__left, .content__right {
    width: 50%;
    position: relative;
    @media all and (max-width: $mobile) {
        width: 100%;
    }
}

.content__right {
    visibility: hidden;
}

.content__h1 {
    visibility: hidden;
    font-size: 3em;
    line-height: 1.3em;
    position: relative;
    color: $white;
