.content__h4 {
    visibility: hidden;
    font-size: 1.2em;
    font-weight: 500;
    line-height: 2em;
    position: relative;
    color: $main2;
}

.content__h4::after {
    @include after-black;
}

.profile__img {
    margin-left: 60px;
    width: 40%;
    height: 100%;
    position: relative;
    background: url('../img/profile.png') no-repeat;
    background-size: cover;
    -webkit-transform-style: preserve-3d;
    transform-style: preserve-3d;
    @media all and (max-width: $mobile) {
        margin: 200px 0 0 0;
        width: 100%;
        .cutout {
            max-width: 100vw;
        }
    }
}

.content__right::after {
    @include after-black;
    top: -10%;
    height: 130%;
}

